const printToDom = (divId, textToPrint) => {
    const selectedDiv = document.getElementById(divId);
    selectedDiv.innerHTML = textToPrint;
};
const buildPetCards = () => {
    let domString = '';
    for(let i = 0; i < pets.length; i++){
        domString += '<div class = "pets center">';
        domString += `<img class="img" src= "${pets[i].imageUrl}" alt= "A picture of a ${pets[i].type}">`;
        domString += `<h3>${pets[i].name}</h3>`;
        domString += `<p class= "center">Name: ${pets[i].name}</p>`;
        domString += `<p>Color: ${pets[i].color}</p>`;
        domString += `<p>Type: ${pets[i].type}</p>`;
        domString += `<p>Special Skills: ${pets[i].specialSkill}</p></div>`;
    };
printToDom('petAdoption', domString);
};

